import React from "react";
import '../Assets/Styles/HomeComponentStyles.css'
import { useSpring, animated } from '@react-spring/web';
function HomeComponent(){
    const styles = useSpring({
        opacity: 1,
        transform: 'translateY(0px)',
        from: { opacity: 0, transform: 'translateY(20px)' },
        config: { duration: 500 }
      });
    return(
        <main className="container">
            <div className="title">
            <h1>Felipe</h1>
            <h1>Padros</h1>
            </div>
            <animated.div className="job" id="software" style={styles}>
                <span>S</span>
                <span>o</span>
                <span>f</span>
                <span>t</span>
                <span>w</span>
                <span>a</span>
                <span>r</span>
                <span>e</span>
            </animated.div>            
            <animate.div className="job" id="developer" style={styles}>
                <span>D</span>
                <span>e</span>
                <span>v</span>
                <span>e</span>
                <span>l</span>
                <span>o</span>
                <span>p</span>
                <span>e</span>
                <span>r</span>
            </animate.div>
        </main>
    );
}

export default HomeComponent;
